window.bookSummaryJSON = "<p><b>She will be claimed and bred, but first she must be tamed.</b> </p> <p>Only one thing could have awakened Kellan from long centuries of sleep. The scent of his mate. </p> <p>Míorúilt has the blood of dragons in her veins and taming her will be no easy task, but Kellan wouldn't want it to be. While he slumbered, he dreamed of how sternly and shamefully he will punish her defiance and how thoroughly he will claim and ravage her beautiful virgin body. </p> <p>Now it is time. </p> <p><b>Publisher's note:</b> <i>Sealord </i>is a stand-alone novel set in the same world as <i>Warlord</i>, <i>Overlord</i>, <i>Wolflord</i>, and <i>Dragonlord</i>. It includes spankings and sexual scenes. If such material offends you, please don't buy this book.</p>"; 
